    [],nt"revision_timestamp": "2015-07-16T21:37:39.658755",nt"name": "freight-analysis-framework-regions-national",nt"isopen":
    false,nt"url": null,nt"notes": "FAF domestic region level datasets and
    products (NTAD 2015) provide information for states, state portions of large metropolitan
    areas, and remainders of states. Metropolitan areas consist of Metropolitan Statistical
    Areas or Consolidated Statistical Areas as defined by the Office of Management and
    Budget. When a metropolitan area is entirely within a state or when a state's portion
    of a multi-state metropolitan area is large enough to support the sampling procedures
    in the Commodity Flow Survey, the area becomes a separate FAF region. Small single-state
    metropolitan areas and small portions of a multi-state metropolitan area are part
    of the State or Remainder of State. FAF has two metropolitan areas that are each
    divided into three FAF regions, four that are each divided into two FAF regions,
    and several that have small pieces combined with States or Remainders of States.",nt"license_title":
